import React from 'react';
import styles from './SocialMedia.css';

export const SocialMedia = () => {
  return (
    <>
    <div>
        <div className="info">
            <h3>Social Media</h3>
            <div className="item-sm"><i class="fa fa-twitter"></i><a href="">Twitter</a></div><br />
            <div className="item-sm"></div><i class="fa fa-youtube"></i><a href="">Youtube</a><br />
            <div className="item-sm"></div><i class="fa fa-instagram"></i><a href="">Instagram</a><br />
            <div className="item-sm"></div><i class="fa fa-facebook"></i><a href="">Facebook</a><br />
        </div>
    </div>
    </>
  )
}
